webpackJsonp([26781520009692],{1031:function(e,a){e.exports={data:{package:{id:"bs-react-fela",score:.4835624745398719,name:"bs-react-fela",version:"0.2.0",description:"BuckleScript bindings for react-fela",keywords:["react","fela","bucklescript","reason"],license:"MIT",updated:"2017-12-10T17:55:16.301Z",stars:6,type:"published",quality:.41167447740795426,popularity:.03437107291071474,maintenance:.9943721594249584,readme:'<h1>bs-react-fela</h1>\n<p>Reason/BuckleScript bindings for\n<a href="https://github.com/rofrischmann/fela/tree/master/packages/react-fela">react-fela</a>.\nSee also\n<a href="https://github.com/astrada/bs-react-fela-examples">bs-react-fela-examples</a>.</p>\n<p>From Fela <a href="http://fela.js.org/">documentation</a>:</p>\n<p>Fela is a small, high-performant and framework-agnostic toolbelt to handle\nstate-driven styling in JavaScript. It is dynamic by design and renders your\nstyles depending on your application state.</p>\n<p>It generates atomic CSS and supports all common CSS features such as media\nqueries, pseudo classes, keyframes and font-faces. Fela ships with a powerful\nplugin API adding e.g. <a href="http://fela.js.org/packages/fela-plugin-prefixer">vendor\nprefixing</a> or <a href="http://fela.js.org/packages/fela-plugin-fallback-value">fallback\nvalue</a> support.</p>\n<p>Fela can be used with\n<a href="https://github.com/rofrischmann/fela/tree/master/packages/react-fela">React</a>\nor with any other view library. It even supports <a href="http://fela.js.org/docs/guides/UsageWithReactNative.html">React\nNative</a>.</p>\n<h3>Prerequisites</h3>\n<pre><code>npm install --global bs-platform\nyarn install\n</code></pre>\n<h3>How to compile</h3>\n<pre><code>yarn build\n</code></pre>\n<h3>How to use (in your projects)</h3>\n<p>Run:</p>\n<pre><code>yarn add --dev bs-react-fela\n</code></pre>\n<p>to add the library to your project dependencies. And add <code>bs-react-fela</code> to <code>dependencies</code> node of your <code>bsconfig.json</code>.</p>\n',homepageUrl:"https://github.com/astrada/bs-react-fela",repositoryUrl:"https://github.com/astrada/bs-react-fela",npmUrl:"https://www.npmjs.com/package/bs-react-fela",issuesUrl:"https://github.com/astrada/bs-react-fela/issues",slug:"packages/bs-react-fela"}},pathContext:{id:"bs-react-fela"}}}});
